import "./App.css";
import React, { Component, useEffect  } from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect
} from "react-router-dom";
import Header from "./Header";
import Home from "./Home";
import Login from "./Login/login";
import Signup from "./Login/signup";
import Signout from './Login/signout';
import Profile from './User/profile';
import Calendar from './User/calendar';
import history from './history';
//import {Authenticate} from './auth';
import Auth from './Login/auth';
import getJwt from './Login/jwt';
import auth from './Login/test';


//        <Route path="/profile" render={props => <Auth><Profile {...props} /></Auth>} />


class App extends Component{
  constructor(props) {
    super();
    var jwt = getJwt();
    this.state = {
      Authenticated: jwt
    };
    
  }
  useEffect() {
    auth(jwt);
    }
  render() {
    return (
      <div className="App">
        <Header />
        <Router history={history}>
          <Route exact path="/home" component={Home} />
          <Route exact path="/login" component={Login} />
          <Route exact path="/signup" component={Signup} />
          <Route path="/calendar" render={props => <Auth><Calendar {...props} /></Auth>} />
          <Route path="/signout" render={props => <Auth><Signout {...props} /></Auth>} />
          
          <Route
            exact
            path="/calandar"
            render={() => {
                return (
                    this.state.Authenticated ?
                    <Redirect to="/calandar" /> :
                    <Redirect to="/login" /> 
                )
            }}
        />
          <Route
            exact
            path="/test"
            render={() => {
                return (
                    this.state.Authenticated ?
                    <Redirect to="/profile" /> :
                    <Redirect to="/login" /> 
                )
            }}
        />
          <Route exact path="/">
            <Redirect to="/home" />
          </Route>
        </Router>
      </div>
    );
  }
}
//
export default App;
